import React from 'react'
import { Container } from 'react-bootstrap'
import styled from 'styled-components'

const Styles = styled.div`
    .container {
        text-color: white
        text-align: center;
        margin-top: 18vh;
        z-index: 0;
    }
`

export const Layout = (props) => (
    <Container>
        {props.children}
    </Container>
)
